import React from "react";

const Header = () => {

  const handleHeader = () => {
    const headerText = ["Sweetheart", "Stupid"];
    const int = Math.floor(Math.random() * 2);
    return headerText[int];
  };

  return (
    <header style={{
      backgroundColor: "lightyellow", 
      color: 'blue'
    }}>
      <h1>Welcome to my page, {handleHeader()}</h1>
    </header>
  );
};

export default Header;
